import { Injectable } from '@angular/core';
import { Observable, of } from 'rxjs';
import { IMovie } from '../../assets/data/IMovie';
import { Movie } from '../../assets/data/Movie';
import { Guid } from "guid-typescript";

@Injectable({
  providedIn: 'root'
})
export class MovieService {
  moviesList: IMovie[] = [
    new Movie(
    { 
      id: Guid.create().toString(), 
      title: "Pepsi Movie", 
      photoUpload: "data:image/png;base64,", 
      subtitle: "During the Great Depression, Pepsi gained popularity following the introduction in 1934 of a 12-ounce bottle.", 
      description: "Pepsi was first invented in 1893 as Brad's Drink by Caleb Bradham, who sold the drink at his drugstore in New Bern."
    }),
    new Movie(
    { 
      id: Guid.create().toString(), 
      title: "KFC Film", 
      photoUpload: "data:image/png;base64,",
      subtitle: "Throughout the 1970s and 1980s, it experienced mixed fortunes domestically, as it went through a series of changes in corporate ownership with little.", 
      description: "KFC (Kentucky Fried Chicken) is an American fast food restaurant chain headquartered in Louisville, Kentucky.."
    }),
    new Movie(
    { 
      id: Guid.create().toString(), 
      title: "Apple Cinema", 
      photoUpload: "data:image/png;base64,", 
      subtitle: "As the market for personal computers expanded and evolved throughout the 1990s, Apple lost considerable market share to the lower-priced duopoly.", 
      description: "Apple Inc. is an American multinational technology company headquartered in Cupertino, California."
    })
  ];

  constructor() { 
  }

  getMovies() : Observable<IMovie[]>{
    return of(this.moviesList);
  }

  public createMovie(title: string, photoUpload: string, subtitle: string, description: string) {
    this.moviesList.push(new Movie({ id: Guid.create().toString(), title: title, photoUpload: photoUpload, subtitle: subtitle, description: description}));
  }
}